import React from 'react';
import '../styles/Login_page.css';

const LoginPage = () => {
  return (
    <div className="login-body">
      <div className="login-header">
        <a className="login-logo">Heart Med</a>
      </div>
      <div className="login-container">
        <h2>Login</h2>
        <form action="/login" method="POST">
          <input type="text" name="username" placeholder="Username" required />
          <input type="password" name="password" placeholder="Password" required />
          <h2 style={{ fontSize: '20px', textAlign: 'left', color: 'red' }}>*Incorrect password</h2>
          <button className="login-button"><a href="homepage.html">Login</a></button>
          <h3> Not a member ? <a style={{ color: 'white', textDecoration: 'none' }} href="signup.html">Signup</a></h3>
        </form>
      </div>
    </div>
  );
}

export default LoginPage;
